import './App.css';
import { BrowserRouter as Router, Route, Routes, } from 'react-router-dom';
import HomePage from './pages/HomePage';

function App() {
  return (
    <div className="App">
      <Router>
        <h1>Header</h1>
        <hr />
        <Routes>
          <Route path='/' exact Component={HomePage} />
        </Routes>
      </Router>
    </div>
  );
}

export default App;
